import { useContext } from "react";
import { DynamicColorIOS, Text, View } from "react-native";
import nameContext from "./profileContext";

const NameTag = ({days}) =>{
    const {name} = useContext(nameContext)

    if(days == 0){
        return null;
    }
    return(
        <View>
            <Text>You have adopted {name} for {days} days _(:_」∠)_</Text>
        </View>
    )
}

export default NameTag;
